import React from 'react'
import TextField from '@mui/material/TextField';
import '../App.css';
import Button from '@mui/material/Button';
import { Box } from '@mui/system';

const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'white',
  border: '2px solid #000',
  height: 200,
  padding: 3,
  boxShadow: "1px 3px 1px #9E9E9E",
}; 

export default function AddData({closeAddModal}) {
  return (
    <div className='modalBackground'>
    <div className='modalContainer'>
      <TextField id="demo-helper-text-misaligned-no-helper" label="Title" className='add-title'/>
      <br></br>
      <TextField id="demo-helper-text-misaligned-no-helper" label="Description" className='add-desc '/>
      <Button variant="contained" color="inherit">Add</Button>
      <Button variant="outlined" color="inherit" onClick={() => closeAddModal(false)}>Cancel</Button>
    </div>
    </div>
  )
}
